import{_ as e,o as i,c as t,O as a}from"./chunks/framework.9482e208.js";const _=JSON.parse('{"title":"§ 13.1-1050 Articles of cancellation.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/13.1-1050.md","filePath":"vacode/13.1-1050.md"}'),l={name:"vacode/13.1-1050.md"},o=a('<h1 id="§-13-1-1050-articles-of-cancellation" tabindex="-1">§ 13.1-1050 Articles of cancellation. <a class="header-anchor" href="#§-13-1-1050-articles-of-cancellation" aria-label="Permalink to &quot;§ 13.1-1050 Articles of cancellation.&quot;">​</a></h1><p>A. When the affairs of a limited liability company have been wound up pursuant to § <a href="http://law.lis.virginia.gov/vacode/13.1-1048/" target="_blank" rel="noreferrer">13.1-1048</a>, it shall file articles of cancellation with the Commission. The articles shall set forth:</p><ol><li><p>The name of the limited liability company;</p></li><li><p>The identification number issued by the Commission to the limited liability company;</p></li><li><p>The effective date of its certificate of organization;</p></li><li><p>A statement that the limited liability company has completed the winding up of its affairs; and</p></li><li><p>Any other information the members determine to include therein, including the reason for filing the articles of cancellation.</p></li></ol><p>B. If the Commission finds that the articles of cancellation comply with the requirements of law and that all required fees have been paid, it shall by order issue a certificate of cancellation, canceling the limited liability company&#39;s existence. Upon the effective date of such certificate, the existence of the limited liability company shall cease, except for the purpose of suits, other proceedings, and appropriate actions by members as provided in this chapter.</p><p>1991, c. 168; 2006, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?061+ful+CHAP0748" target="_blank" rel="noreferrer">748</a>; 2008, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?081+ful+CHAP0108" target="_blank" rel="noreferrer">108</a>; 2013, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?131+ful+CHAP0017" target="_blank" rel="noreferrer">17</a>.</p>',5),n=[o];function r(c,s,h,f,p,d){return i(),t("div",null,n)}const g=e(l,[["render",r]]);export{_ as __pageData,g as default};
